/* @flow strict-local */
import React, { useCallback, useMemo, useState } from 'react';
import type { Node } from 'react';
import { ActivityIndicator, Alert, Image, TouchableOpacity, View } from 'react-native';

import invariant from 'invariant';
import type { RouteProp } from '../react-navigation';
import type { AppNavigationProp } from '../nav/AppNavigator';
import type { Auth, User, UserId } from '../types';
import globalStyles, { BRAND_COLOR, createStyleSheet } from '../styles';
import { useSelector, useDispatch, useGlobalSelector } from '../react-redux';
import Screen from '../common/Screen';
import ZulipButton from '../common/ZulipButton';
import ZulipTextIntl from '../common/ZulipTextIntl';
import { IconAlertTriangle, IconCall, IconPrivateChat } from '../common/Icons';
import { pm1to1NarrowFromUser } from '../utils/narrow';
import AccountDetails from './AccountDetails';
import ZulipText from '../common/ZulipText';
import ActivityText from '../title/ActivityText';
import { doNarrow } from '../actions';
import {
  getCustomProfileFieldsForUser,
  getFullNameReactText,
  getOwnUser,
  getUserIsActive,
  tryGetUserForId
} from '../users/userSelectors';
import { nowInTimeZone } from '../utils/date';
import CustomProfileFields from './CustomProfileFields';
import { getGlobalSettings, getRealm } from '../directSelectors';
import { openLinkExternal, openLinkWithUserPreference } from '../utils/openLink';
import * as api from '../api';
import { getAuth } from '../account/accountsSelectors';
import { base64Utf8Encode } from '../utils/encoding';

const base64ZaloIcon = 'data:image/png;base64,';
const base64ZaloDisableIcon = 'data:image/png;base64,';
const base64TelegramIcon = 'data:image/png;base64,';
const base64TelegramDisableIcon = 'data:image/png;base64,';

const styles = createStyleSheet({
  errorText: {
    marginHorizontal: 16,
    marginVertical: 32,
    textAlign: 'center',
  },
  pmButton: {
    marginHorizontal: 16,
    marginBottom: 16,
  },
  deactivatedText: {
    textAlign: 'center',
    paddingBottom: 20,
    fontStyle: 'italic',
    fontSize: 18,
  },
  itemWrapper: {
    alignItems: 'center',
    marginBottom: 12,
    marginHorizontal: 16,
  },
  buttonRed: {
    flex: 1,
    backgroundColor: '#CF232A',
  },
});

type Props = $ReadOnly<{|
  navigation: AppNavigationProp<'account-details'>,
  route: RouteProp<'account-details', {| userId: UserId |}>,
|}>;

function ReportUserButton({ user, ownUser }) {
  const globalSettings = useGlobalSelector(getGlobalSettings);
  const openReportPage = useCallback(() => {
    openLinkWithUserPreference(new URL(`https://tech.nextpay.vn/nextpay-talk-user-report?me=${ownUser.full_name}&reported_user=${user.full_name}`), globalSettings);
  }, [globalSettings, ownUser, user]);
  return (
    <ZulipButton
      style={styles.buttonRed}
      text="Report user"
      Icon={IconAlertTriangle}
      onPress={openReportPage}
    />
  );
}

async function getUserContact(auth: Auth, user: User) {
  const token = base64Utf8Encode(`${auth.email}:${auth.apiKey}`);
  const response = await api.getPhone(auth.realm, user.email, token);
  const json = await response.json()
      .catch(() => undefined);
  console.log('///--- API TALK RESPONSE ---///', response, json);
  if (json?.success) {
    return {
      phone: json.data?.Phone,
      zalo: json.data?.Zalo,
      telegram: json.data?.Telegram,
    };
  } else {
    Alert.alert('', json?.message && json.message.length ? json.message : 'Oops! Something went wrong.');
  }
  return {};
}

export default function AccountDetailsScreen(props: Props): Node {
  const dispatch = useDispatch();
  const ownUser = useSelector(getOwnUser);
  const user = useSelector(state => tryGetUserForId(state, props.route.params.userId));
  const isActive = useSelector(state => getUserIsActive(state, props.route.params.userId));
  const enableGuestUserIndicator = useSelector(state => getRealm(state).enableGuestUserIndicator);
  const realm = useSelector(state => state.realm);
  const userProfileFields = useMemo(() => getCustomProfileFieldsForUser(realm, user), [realm, user]);
  const auth = useSelector(getAuth);
  const [phoneValue, setPhoneValue] = useState<string>('');
  const [zaloValue, setZaloValue] = useState<string>('');
  const [telegramValue, setTelegramValue] = useState<string>('');
  const [contactLoadingValue, setContactLoadingValue] = useState<boolean>(false);

  const handleChatPress = useCallback(() => {
    invariant(user, 'Callback handleChatPress is used only if user is known');
    dispatch(doNarrow(pm1to1NarrowFromUser(user)));
  }, [user, dispatch]);

  if (!user) {
    return (
      <Screen title="Error">
        <ZulipText style={styles.errorText} text="Could not show user profile." />
      </Screen>
    );
  }

  let localTime: string | null = null;
  // See comments at CrossRealmBot and User at src/api/modelTypes.js.
  if (user.timezone !== '' && user.timezone !== undefined) {
    try {
      localTime = `${nowInTimeZone(user.timezone)} Local time`;
    } catch {
      // The set of timezone names in the tz database is subject to change over
      // time. Handle unrecognized timezones by quietly discarding them.
    }
  }

  const userProfilePhone = userProfileFields.find(e => (e.name ?? '').toLowerCase() === 'phone');
  const userProfileZalo = userProfileFields.find(e => (e.name ?? '').toLowerCase() === 'zalo');
  const userProfileTelegram = userProfileFields.find(e => (e.name ?? '').toLowerCase() === 'telegram');
  const showCall = true;
  const showZalo = true;
  const showTelegram = true;
  const enableCall = user.email !== ownUser.email && userProfilePhone?.value?.text && userProfilePhone?.value?.text.length;
  const enableZalo = user.email !== ownUser.email && userProfileZalo?.value?.text && userProfileZalo?.value?.text.length;
  const enableTelegram = user.email !== ownUser.email && userProfileTelegram?.value?.text && userProfileTelegram?.value?.text.length;

  return (
    <Screen title={getFullNameReactText({ user, enableGuestUserIndicator })}>
      <AccountDetails user={user} showEmail showStatus />
      <View style={styles.itemWrapper}>
        <ActivityText style={globalStyles.largerText} user={user} />
      </View>
      <View style={{ flexDirection: 'row', justifyContent: 'center' }}>
        {showCall
          && (
          <TouchableOpacity
            onPress={async () => {
              let phoneValueHandle = phoneValue && phoneValue.length ? phoneValue : userProfilePhone.value.text;
              if (phoneValueHandle.indexOf('*') > -1) {
                setContactLoadingValue(true);
                const data = await getUserContact(auth, user);
                setContactLoadingValue(false);

                setPhoneValue(data.phone ?? '');
                setZaloValue(data.zalo ?? '');
                setTelegramValue(data.telegram ?? '');

                phoneValueHandle = data.phone ?? '';
              }
              if (phoneValueHandle && phoneValueHandle.length) {
                try {
                  openLinkExternal(new URL(`tel:${phoneValueHandle}`));
                } catch (_) {
                  console.log('Exception', _);
                }
              }
            }}
            style={{ width: 48, height: 48, marginHorizontal: 8, marginBottom: 8, backgroundColor: enableCall ? BRAND_COLOR : '#ADAFB0', justifyContent: 'center', alignItems: 'center', borderRadius: 8, }}
            activeOpacity={0.8}
            disabled={!enableCall || contactLoadingValue}
          >
            {contactLoadingValue ? <ActivityIndicator size="small" color="white" /> : <IconCall size={32} color="white" />}
          </TouchableOpacity>
        )}
        {showZalo
          && (
          <TouchableOpacity
            onPress={async () => {
              let zaloValueHandle = zaloValue && zaloValue.length ? zaloValue : userProfileZalo.value.text;
              if (zaloValueHandle.indexOf('*') > -1) {
                setContactLoadingValue(true);
                const data = await getUserContact(auth, user);
                setContactLoadingValue(false);

                setPhoneValue(data.phone ?? '');
                setZaloValue(data.zalo ?? '');
                setTelegramValue(data.telegram ?? '');

                zaloValueHandle = data.zalo ?? '';
              }
              if (zaloValueHandle && zaloValueHandle.length) {
                try {
                  openLinkExternal(new URL(zaloValueHandle));
                } catch (_) {
                  console.log('Exception', _);
                }
              }
            }}
            style={{ marginHorizontal: 8, backgroundColor: 'transparent', justifyContent: 'center', alignItems: 'center' }}
            activeOpacity={0.8}
            disabled={!enableZalo || contactLoadingValue}
          >
            <Image style={{ width: 48, height: 48, borderRadius: 8, marginBottom: 8, }} source={{ uri: enableZalo ? base64ZaloIcon : base64ZaloDisableIcon }} resizeMode="cover" />
            {contactLoadingValue ? <ActivityIndicator style={{ position: 'absolute' }} size="small" color={BRAND_COLOR} /> : <View />}
          </TouchableOpacity>
        )}
        {showTelegram
            && (
            <TouchableOpacity
              onPress={async () => {
                      let telegramValueHandle = telegramValue && telegramValue.length ? telegramValue : userProfileTelegram.value.text;
                      if (telegramValueHandle.indexOf('*') > -1) {
                        setContactLoadingValue(true);
                        const data = await getUserContact(auth, user);
                        setContactLoadingValue(false);

                        setPhoneValue(data.phone ?? '');
                        setZaloValue(data.zalo ?? '');
                        setTelegramValue(data.telegram ?? '');

                        telegramValueHandle = data.telegram ?? '';
                      }
                      if (telegramValueHandle && telegramValueHandle.length) {
                        try {
                          openLinkExternal(new URL(telegramValueHandle));
                        } catch (_) {
                          console.log('Exception', _);
                        }
                      }
                    }}
              style={{ marginHorizontal: 8, backgroundColor: 'transparent', justifyContent: 'center', alignItems: 'center' }}
              activeOpacity={0.8}
              disabled={!enableTelegram || contactLoadingValue}
            >
              <Image style={{ width: 48, height: 48, borderRadius: 8, marginBottom: 8, }} source={{ uri: enableTelegram ? base64TelegramIcon : base64TelegramDisableIcon }} resizeMode="cover" />
              {contactLoadingValue ? <ActivityIndicator style={{ position: 'absolute' }} size="small" color={BRAND_COLOR} /> : <View />}
            </TouchableOpacity>
            )}
      </View>
      {/* {localTime !== null && ( */}
      {/* <View style={styles.itemWrapper}> */}
      {/*   <ZulipText style={globalStyles.largerText} text={localTime} /> */}
      {/* </View> */}
      {/* )} */}
      <View style={styles.itemWrapper}>
        <CustomProfileFields user={user} />
      </View>
      {!isActive && (
        <ZulipTextIntl style={styles.deactivatedText} text="(This user has been deactivated)" />
      )}
      <ZulipButton
        style={styles.pmButton}
        text={isActive ? 'Send direct message' : 'View direct messages'}
        onPress={handleChatPress}
        Icon={IconPrivateChat}
      />
      {user.email === ownUser.email ? <View /> : (
        <View style={styles.pmButton}>
          <ReportUserButton user={user} ownUser={ownUser} />
        </View>
      )}
    </Screen>
  );
}
